import React from 'react';
import ReactDOM from 'react-dom';

const Hello = () => {
  const now = new Date()

  return(
  <div>
    <p>Hello World, it is {now.toString()}</p>
  </div>
  )
}

const App = () => {
  return(
    <div>
      <h1>Greetings</h1>
      <Hello />
    </div>
  )
}

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
